const App = () => {

  return <>
          <Logo />
          <BestPokemon />
          <CaughtPokemon />
       </>
}


const BestPokemon = () => {
const abilities = ['Anticipation', 'Adaptability', 'Run-Away']
        return  <>
                  <ul>
                    { abilities.map((name) =>(
                      <li>{name}</li>))}
                  </ul>
                  <p>Para mi el mejor pokemon es El mago oscuro</p>
                </>
}

const CaughtPokemon = () => {
  const date = new Date().toLocaleDateString();

  return <>
            <p>Caught 0 Pokemon on</p>
            <p>{date}</p> 
           </> 

}

export default App;
